    data: |
      SELECT - - 76 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE + col0 * col0 + 57 NOT BETWEEN + - col0 AND - col0 + - CAST ( NULL AS INTEGER ) + - col0;
  - name: tab0

outputs:
  - name: q10757.out
    data: |
